import React, {Component} from "react";


class ProfilePage extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <React.Fragment>
                <div className="container">
                    <div className="row">
                        <div className="col-12 text-left mt-2">
                            <h4>Marius</h4>
                        </div>
                    </div>
                </div>

            </React.Fragment>
        );
    }
}

export default ProfilePage;
